import React from 'react';

function Characters(props) {
    const [homeworld, setHomeworld] = useState([])
    const getHomeworld = async () => {
        const response = await axios.get(`${person.homeworld.name}`)
        setHomeworld(response.data.results)
    }

    return (
        <div className = "grid">
    {
    props.characters.map((person) => (

        <div key={person.model} className="card">
            <h3> Name:{person.name}</h3>
            <h4>Birth Year:{person.birth_year}</h4>
            <h4>Height: {person.height}cm</h4>
            <h4>Homeworld: {homeworld}</h4>
        </div>
    ))
    }
    </div>
    );
}

export default Characters;
